import { Box, Heading, TabNav, Text } from '@primer/react';

export function CodeSnippet() {
  return (
    <Box
      sx={{
        border: '1px solid',
        borderColor: 'border.default',
        borderRadius: 2,
        alignSelf: 'flex-start',
        width: '100%',
        maxWidth: '600px',
        overflow: 'hidden',
      }}
    >
      <Box
        sx={{
          borderBottom: '1px solid',
          borderColor: 'border.default',
          p: 3,
        }}
      >
        Get label
      </Box>
      <Box
        sx={{
          pt: 2,
          px: 3,
        }}
      >
        <TabNav
          aria-label='Main'
          sx={{
            marginBottom: '-1px',
          }}
        >
          <TabNav.Link
            href='#'
            selected
            sx={{
              bg: 'transparent !important',
            }}
          >
            Home
          </TabNav.Link>
          <TabNav.Link href='#'>Documentation</TabNav.Link>
          <TabNav.Link href='#'>Support</TabNav.Link>
        </TabNav>
      </Box>
      <Box
        sx={{
          bg: 'canvas.subtle',
          borderTop: '1px solid',
          borderColor: 'border.default',
          p: 3,
          fontSize: 1,
        }}
      >
        <pre>
          <Text sx={{ color: 'fg.muted' }}>curl -L \</Text>
          <Text sx={{ color: 'accent.fg' }}>-L \</Text>
          <br />
          <Text>{'  '}-H "Accept: application/vnd.github+json" \</Text>
          <br />
          <code>{'  '}-H "Authorization: Bearer YOUR-TOKEN" \</code>
          <br />
          <code>{'  '}-H "X-GitHub-Api-Version: 2022-11-28" \</code>
          <br />
          <Box
            sx={{
              display: 'flex',
            }}
          >
            <code>http(s)://</code>
            <code
              sx={{
                color: 'red',
              }}
            >
              HOSTNAME
            </code>
            <code>/api/v3/repos/OWNER/REPO/commits</code>
          </Box>
        </pre>
      </Box>
    </Box>
  );
}
